module.exports = loadPdfFonts = (jsPDF) => {

    const fontsLoaders = [
        loadOpenSansNormal,
        loadOpenSansBoldItalic,
        loadOpenSansItalic,
        loadOswaldRegularNormal,
        loadOswaldExtraLightNormal,
    ]

    for(fontLoader of fontsLoaders) {
        fontLoader(jsPDF.API);
    }

}

const loadOpenSansNormal = (jsPDFAPI) => {
    var font = '';
    var callAddFont = function () {
        this.addFileToVFS('OpenSans-normal.ttf', font);
        this.addFont('OpenSans-normal.ttf', 'OpenSans', 'normal');
    };
    jsPDFAPI.events.push(['addFonts', callAddFont])
}

